import './Cell.css';
import React from 'react';

const Cell = ({ value, onClick, isRevealed }) => {

  return (
    <div className='cell_wrapper'>
      <button
        className={isRevealed ? 'revealed' : ''}
        onClick={onClick}
        disabled={isRevealed}
      >
        {isRevealed ? value : ""}
      </button>
    </div>
  );
};

export default Cell;
